              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"Fashion"} heading={"Trending Fashion"} />
          <div className="grid grid-cols-8 gap-10">
            <FashionCard image={fa1} />
            <FashionCard image={fa2} />
            <FashionCard image={fa3} />
            <FashionCard image={fa4} />
            <FashionCard image={fa5} />
            <FashionCard image={fa6} />
            <FashionCard image={fa4} />
            <FashionCard image={fa5} />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"This month"} heading={"New Arrivals"} />
          <div className="grid grid-cols-4">
            <img className="w-80 mx-auto" src={arr1} alt="" />
            <img src={arr1} alt="" />
            <img src={arr1} alt="" />
            <img src={arr1} alt="" />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"Accessories"} heading={"Electronics Accessories"} />
          <div className="grid grid-cols-3 gap-10">
            <AccessoryCard />
            <AccessoryCard />
            <AccessoryCard />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Homepage;
